import React from 'react';
import { withStyles } from '@material-ui/core';
import Poster from '../Poster/index';

const List = (props) => {
  const { classes, movieList } = props;

  const list_0 = [];
  const list_1 = [];
  const list_2 = [];
  const list_3 = [];

  for (var i = 0; i<5; i++) {
    if (movieList[i]) {
      list_0.push(<Poster {...movieList[i]} />)
    }
  };

  for (var i = 5; i<10; i++) {
    if (movieList[i]) {
      list_1.push(<Poster {...movieList[i]} />)
    }
  };

  for (var i = 10; i<15; i++) {
    if (movieList[i]) {
      list_2.push(<Poster {...movieList[i]} />)
    }
  };

  for (var i = 15; i<20; i++) {
    if (movieList[i]) {
      list_3.push(<Poster {...movieList[i]} />)
    }
  };

  return (
    <div>
      <div className= {classes.rowList}>
        {list_0}
      </div>
      <div className= {classes.rowList}>
        {list_1}
      </div>
      <div className= {classes.rowList}>
        {list_2}
      </div>
      <div className= {classes.rowList}>
        {list_3}
      </div>
  </div>
  );
};

const styles = {
  rowList: {
    display: 'flex',
    flexDirection: 'row'
  }
};

export default withStyles(styles)(List);
